// src/components/Footer.jsx
import React from 'react';

const Footer = () => {
  return (
    <>
      <div>
        <img src="/assets/images/profile.jpg" alt="Foto Profil" className="w-64 h-40" />
      </div>
    </>
  );
};

export default Footer;
